import React from "react";
import { Link } from "react-router-dom";

const ButtonMailTo = ({ mailto, label }) => {
    return (
        <router>
        <Link
            to='#'
            onClick={(e) => {
                window.location = mailto;
                e.preventDefault();
            }}
        >
            {label}
        </Link>
        </router>
    );
};

export default ButtonMailTo;
